const { DataTypes, Sequelize } = require('sequelize')

const { MySql } = require('../db')

const Catalogue = MySql.define('Catalogue', {
    id: {
        type: Sequelize.INTEGER,
        autoIncrement:true,
        primaryKey: true,
    },
    catalogueHierarchy:{
        type: DataTypes.STRING,
        allowNull:false
    },
    text: {
        type: DataTypes.STRING,
        unique: true,
        allowNull: false
    },
    parentId: {
        type: DataTypes.STRING,
    },
    active: {
        type: DataTypes.BOOLEAN,
        defaultValue: true,
    },
    createdBy: {
        type: DataTypes.STRING,
        allowNull: false
    },
    updatedBy: {
        type: DataTypes.STRING
    }

})

module.exports = Catalogue

